      .select()
      .from("ListingDetails")
      .where({ ListingId: searchId })
      .then((row) => {
        response.Status = true;
        response.Refrence = row;
        response.Description = "  ";
      })
      .catch((err) => {
        response.Status = false;
        response.Refrence = err;
        response.Description = "     ";
      })
      .finally(() => {
        return callBack(response);
      });
  },
};

